DESCRIPTIF_LONG:
Ce site met à disposition les dernières données collectées dans le cadre du suivi des mises en conformité des ouvrages d'assainissement. 
Notamment :
- les informations détaillées des stations de traitement des eaux usées des agglomérations d'assainissement du territoire métropolitain et des départements d'outre-mer, ainsi que leurs niveaux de conformité au regard de la directive «Eaux Résiduaires Urbaines» ;
- les informations et références documentaires relatives à la gestion des eaux pluviales urbaines ;
- le recueil des textes réglementaires de l'assainissement communal (collectif, pluvial, non-collectif) ;
- les services proposés par le portail (export de toutes les données, documents "types", suite logicielle ...).
